import React from "react";
import styled from "styled-components";
import HeaderLinks from "./Constants";

const HeaderNavLink = styled.a.attrs({
  className: ` ${props.isButton &&
    "cursor-pointer whitespace-no-wrap"} no-underline`
})`
  margin-left: 20px;
  color: ${props =>
    props.active ? "#121212" : props.isButton ? "#fff" : "hsla(0,0%,7%,.5)"};
  font-size: 16px;
  @media (min-width: 1020px) {
    font-size: 18px;
  }
  ${props =>
    props.isButton &&
    `
    font-family: FuturaBT-Book,sans-serif
    font-size: 18px;
    font-weight: 300;
    background: #ffb21a;
    border-radius: 52px;
    padding: 16px 20px 15px;
    transition: background 80ms linear, opacity 1s linear;`}
`;

const HeaderNav = () => (
  <nav className="lg:block md:block hidden">
    <ul className="flex justify-end">
      {HeaderLinks.map((link, index) => (
        <li key={index}>
          <HeaderNavLink active={link.active} isButton={link.isButton}>
            {link.name}
          </HeaderNavLink>
        </li>
      ))}
    </ul>
  </nav>
);

export default HeaderNav;
